import Header from './Components/Header';
import {Routes,Route} from 'react-router-dom'
import Home from './Components/Home';
import Footer from './Components/Footer';
import About from './Components/About';
import NotFound from './Components/NotFound';
import Terms from './Components/TC';
import './App.css';
import Blog from './Components/Blog';
import BlogAlgo from './Components/BlogAlgo';

function App() {
  return (
    <div className="App">
      <Header/>
      <Routes>

        <Route exact path='/' element={<Home/>}/>
        <Route exact path='/home' element={<Home/>}/>
        <Route exact path='/about' element={<About/>}/>
        <Route exact path='/terms-and-conditions' element={<Terms/>}/>
        <Route exact path='/blog' element={<Blog/>}/>
        <Route exact path='/blog/algorithmic-trading' element={<BlogAlgo/>}/>
        {/* <Route path='technical-analysis' element={<BlogAlgo/>}/>
        <Route path='algorithmic-trading' element={<BlogAlgo/>}/>
        <Route path='algorithmic-trading' element={<BlogAlgo/>}/>
        <Route path='algorithmic-trading' element={<BlogAlgo/>}/> */}
        <Route path='*' element={<NotFound/>}/>
      </Routes>
      <Footer/>
    </div>
  );
}

export default App;
